import { useEffect, useState } from 'react';
import './App.css';

function App() {

  let [articles, setArticles] = useState([]);

  useEffect(() => {
    fetch("https://newsapi.org/v2/everything?q=openai&from=2023-12-22&apiKey=4f8ca35a1f284d7a9e7dfd9b0c97958f")
    .then((response) => {
      return response.json();
    }).then((news) => {
      console.log(news.articles);
    }).catch((err) => {
      console.log(err);
    });
  }, []);

  return (
    <div className="App">
      <h1>News App</h1>  
    </div>
  );
}

export default App;
